import React from "react";

const Img = ( {props} ) => {
  console.log("Data is", props.val);
  return (
    <div>
      <img
        src={props.image}
        alt=""
        style={{ width: 400, height: 400, padding: "40px" }}
      />
      <div>{props.name}</div>
    </div>
  );
};

export default Img;
